INSERT INTO `exp_channel_data` (`entry_id`, `site_id`, `channel_id`, `field_id_1`, `field_ft_1`) VALUES
(1, 1, 2, 'Entry Content', 'xhtml'),
(2, 1, 2, 'If you ask Twitter''s CEO Dick Costolo why the company decided to buy Vine, an app for creating and sharing six-second videos, the answer is simple: It''s the next big thing. "When Facebook bought Instagram, I said we’re not going do what those other guys did. We’re looking for the next thing," Costolo told The Wall Street Journal in a recent interview. "We all agreed that this is the next thing down the road."\n\nThat might sound like little more than the trademark optimism of a Silicon Valley exec if not for how quickly the app has taken off. In just the two weeks since Vine launched on the iPhone, news outlets have used it to capture stories, brands have used it to create ads and contests, designers have used it to offer glimpses backstage during New York Fashion Week and big name-celebrities have used it to engage with their fans. In fact, the service has been talked about so much — both for good reasons and bad — that Jon Stewart recently dedicated a segment on The Daily Show to making fun of it.', 'xhtml'),
(3, 1, 2, 'The Pirate Bay documentary TPB AFK: The Pirate Bay Away From Keyboard is now available online.\n\nThe film made its premiere at the 63rd Berlin International Film Festival and simultaneously debuted online. TPB AFK chronicles the founders of The Pirate Bay during their legal battle in Sweden. In 2009, the founders were convicted of promoting piracy, sentenced to a year in prison and fined 30 million Swedish krona ($3.5 million).', 'xhtml');
