(1, 1, 1, 'index', 'n', 'webpage', '{html_head}\n<title>Entries Jobsity</title>\n{html_head_end}\n<body>\n{embed="global_embeds/.page_header" header="Entries"}\n<div id="content_pri">\n{exp:channel:entries channel="entries" limit="30"}\n{if no_results}<p>Sample No Results Information</p>{/if}\n	{if count == "1"}\n		<h3 class="recentnews">Recent Entries</h3>\n		<ul id="news_listing">\n	{/if}\n<li>\n				<h4><a href="{comment_url_title_auto_path}">{title}</a> {entry_date format="%F %d %Y"}</h4>\n				<p>Author: {author}</p>\n				\n				{content}\n\n			</li>\n		{if count == total_results}</ul>{/if}\n{/exp:channel:entries}\n</div>\n<div>\n<h2>Tweets</h2>\n{exp:twitter_timeline:feed screen_name="alejovinueza"}\n	<img src="{profile_image_url}" alt="" />\n	<p>{text}</p>\n	<p>Por {screen_name}</p>\n	<p>{created_at}</p>\n{/exp:twitter_timeline:feed}\n</div>\n</body>', '', 1360794250, 1, 'n', 0, '', 'n', 'n', 'o', 74),
